import { Route, Router, Routes } from "react-router-dom";
import Home from "./home" 

function Pavani(){
    return(
        <div>
           <Router>
            <ul>
                <li><link to="/home">Home</link></li>
                <li>page</li>
                <li>gallery</li>
            </ul>
            <Routes>
               <Route path="/home"element={<Home/>}/>
            </Routes>
           </Router>
              
        </div>
    )
}
export default Pavani;
